import { useEffect, useState } from 'react'
import axios from 'axios';

const products = ()=>{
    const [DATA, setProducts] = useState([]);
    useEffect(() => {
        const fetchData = async () => {
            const result = await axios.get('/api/products');
            setProducts(result.data);
        };
        fetchData();
    }, []);
}


export default products;
